import React from 'react'
import './Popup.css'

const Popup = (props) => {
  return (props.trigger) ? (
    <div className='popup'>
        <h1>The website is under construction</h1>
        <div className="popup-inner">
            <button className='close-btn'>close</button>
            { props.children }
        </div>
    </div>
  ) : "";
}

export default Popup
